import './Header.css';

function Header() {
  return (
    <div className="Header">
      <ul>
        <li><a className="Accueil" href='#'>Acccueil</a></li>
        <li><a className="Chevron" href='#'>.</a></li>
        <img src="/logo.png" alt=''></img>
        <li><a className="World" href='#'>World Padel Tour</a></li>
      </ul>
    </div>
  );
}

export default Header;
